import axios from "axios";
import React, { useState, useEffect } from "react";

function NewSale() {
    var productName;
    var salesPerson;
    const [product, setProduct] = useState([]);


    const getProduct = async () => {
        try {
            const response = await axios.get('/products');
            const jsonData = await response.data;

            console.log(jsonData);
            setProduct(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }

    useEffect(() => {
        getProduct();
    }, []);
    let prod = product.map((pro) => {
        return (
            <option value={pro.name}>{pro.name}</option>
        )
    })

    const [salesperson, setSalesPerson] = useState([]);

    const getSalesPerson = async () => {
        try {
            const response = await axios.get('/salespersons');
            const jsonData = await response.data;

            console.log(jsonData);
            setSalesPerson(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }

    useEffect(() => {
        getSalesPerson();
    }, []);

    let sale = salesperson.map((sal) => {
        return (
            <option value={[sal.lname, sal.fname]}>{sal.lname}, {sal.fname}</option>
        )
    })
    const [customer, setCustomer] = useState([]);

    const getCustomer = async () => {
        try {
            const response = await axios.get('/customers');
            const jsonData = await response.data;

            console.log(jsonData);
            setCustomer(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }

    useEffect(() => {
        getCustomer();
    }, []);

    let cust = customer.map((cus) => {
        return (
            <option value={[cus.lname, cus.fname]}>{cus.lname}, {cus.fname}</option>
        )
    })
    return (
        <div className="text-white py-4 w-8/12 px-4">
            <div class="mb-6">
                <div class="">
                    <div class="mb-3 xl:w-70">
                        Product
                        <select class="form-select appearance-none
                                    block
                                    w-full
                                    px-3
                                    py-1.5
                                    text-base
                                    font-normal
                                    text-gray-700
                                    bg-white bg-clip-padding bg-no-repeat
                                    border border-solid border-gray-300
                                    rounded
                                    transition
                                    ease-in-out
                                    m-0
                                    focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none" aria-label="Default select example" onChange={(event) => productName = event.target.value}>
                            <option selected> Click To Select A Product</option>
                            {prod}
                        </select>
                    </div>
                </div>
                <div class="">
                    <div class="mb-3 xl:w-70">
                        Sales Person
                        <select class="form-select appearance-none
                                    block
                                    w-full
                                    px-3
                                    py-1.5
                                    text-base
                                    font-normal
                                    text-gray-700
                                    bg-white bg-clip-padding bg-no-repeat
                                    border border-solid border-gray-300
                                    rounded
                                    transition
                                    ease-in-out
                                    m-0
                                    focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none" aria-label="Default select example" onChange={(event) => salesPerson = event.target.value}>
                            <option selected> Click To Select A Sales Person</option>
                            {sale}
                        </select>
                    </div>
                </div>
                <div class="">
                    <div class="mb-3 xl:w-70">
                        Customer
                        <select class="form-select appearance-none
                                    block
                                    w-full
                                    px-3
                                    py-1.5
                                    text-base
                                    font-normal
                                    text-gray-700
                                    bg-white bg-clip-padding bg-no-repeat
                                    border border-solid border-gray-300
                                    rounded
                                    transition
                                    ease-in-out
                                    m-0
                                    focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none" aria-label="Default select example" onChange={(event) => salesPerson = event.target.value}>
                            <option selected> Click To Select A Customer</option>
                            {cust}
                        </select>
                    </div>
                </div>
                <div class="relative">
                    <div class="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
                        <svg class="w-5 h-5 text-gray-500 dark:text-gray-400" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" d="M6 2a1 1 0 00-1 1v1H4a2 2 0 00-2 2v10a2 2 0 002 2h12a2 2 0 002-2V6a2 2 0 00-2-2h-1V3a1 1 0 10-2 0v1H7V3a1 1 0 00-1-1zm0 5a1 1 0 000 2h8a1 1 0 100-2H6z" clip-rule="evenodd"></path></svg>
                    </div>
                    <input datepicker="" type="text" class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full pl-10 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500 datepicker-input" placeholder="Select date"/>
                </div>

            </div>
        </div>
    )
}

export default NewSale;
